import React, { Component } from "react";
import Navbar from "./components/navbar/navbar";
import "./App.css";

class App extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div class="bg-image"></div>
        <Navbar />
        <div>Hello!</div>
      </React.Fragment>
    );
  }
}

export default App;
